import React from 'react'

const FormComponent = ({ 
  task, 
  handleChange, 
  handleSubmit 
}) => {
  return (
    <div>
      <form 
      action="submit"
      onSubmit={handleSubmit}
      >
        <input 
        type="text" 
        value={task}
        placeholder='Add a task'
        onChange={handleChange}
        />
        <button type="submit">Add</button>
      </form>
    </div>
  )
}

export default FormComponent
